import random

# ---------------------------------------------------------------------
# ** code used to generate the test grids:
#    randomly generated grids with a start and end cell, and 30% blocked cells
# ---------------------------------------------------------------------
def drawGrid():
    grid = []
    for rows in range(101):
        grid.append([])
        for cols in range(101):
            grid[rows].append(0)
    return grid

def startState(grid):
	x = random.randint(0, len(grid)-1)
	y = random.randint(0, len(grid)-1)
	return (x,y)

def goalState(grid):
	x = random.randint(0, len(grid)-1)
	y = random.randint(0, len(grid)-1)
	return (x,y)

def createBlocks(grid):
    for x in range(len(grid)):
        for y in range(len(grid)):
            if(random.random() > 0.7):
                #blocked
                grid[x][y] = 1
            else:
                #open
                grid[x][y] = 0
    return grid

